import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common";

import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <header class="main-container">
      <div class="image-wrapper">
        <div class="description">Plant trees for free</div>
        <div class="description">Make the planet better</div>
      </div>
      <div class="form-wrapper">
        <form>
          <div class="input-container">
            <label for="username">Username</label>
            <input
              id="username"
              type="text"
              class="input-text"
              aria-label="Username"
              aria-role="textbox"
            />
          </div>
          <div class="input-container">
            <label for="password">Password</label>
            <input
              id="password"
              type="password"
              class="input-text"
              aria-label="Password"
              aria-role="textbox"
            />
          </div>
          <button class="submit-button" type="submit">Login</button>
          <div class="div-13">Otherwise, please</div>
          <div class="div-14"><a href="#">Register here</a></div>
        </form>
      </div>
    </header>
  `,
  styles: [
    `
      .main-container {
        display: flex;
        flex-direction: column;
        max-width: 955px;
        margin: 0 auto;
        padding: 50px 16px;
        background-color: var(--whitePure, #081c15);
      }

      .image-wrapper {
        margin: 128px 0 67px;
      }

      @media (max-width: 991px) {
        .image-wrapper {
          max-width: 100%;
          margin: 40px 0;
        }
      }

      .description {
        color: var(--greenDark, #e8f5f1);
        font: 500 24px Poppins, sans-serif;
        white-space: nowrap;
      }

      @media (max-width: 991px) {
        .description {
          white-space: initial;
        }
      }

      .form-wrapper {
        display: flex;
        gap: 20px;
        flex-direction: column;
      }

      @media (max-width: 991px) {
        .form-wrapper {
          flex-direction: column;
          align-items: stretch;
          gap: 0;
        }
      }

      .input-container {
        display: flex;
        flex-direction: column;
        line-height: normal;
      }

      .input-text {
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        height: 40px;
        font: 500 14px Roboto, sans-serif;
      }

      .submit-button {
        color: var(--cardsWhite, #081c15);
        white-space: nowrap;
        justify-content: center;
        align-items: center;
        border-radius: 6px;
        box-shadow: 0px 4px 61px 0px rgba(45, 106, 79, 0.4);
        background-color: var(--cardsMainColor, #f4fbf9);
        margin-top: 32px;
        padding: 11px 60px;
        font: 600 18px Poppins, sans-serif;
      }

      @media (max-width: 991px) {
        .submit-button {
          white-space: initial;
          padding: 0 20px;
        }
      }

      .div-13 {
        color: var(--greenDark, #e8f5f1);
        margin: auto 0;
        font: 400 14px Poppins, sans-serif;
      }

      .div-14 {
        color: var(--greenDark, #e8f5f1);
        font: 600 16px Poppins, sans-serif;
      }
    `,
  ],
})
export class MyComponent {}
